import React from 'react';


const AdminWelcome = () => {

	return (

        <html>

            <head>
                <title>Home</title>
            </head>

            <body>

                <h1>Login</h1>
                <p><a href="adminhome.html">Login as administrator</a></p>
                <p><a href="instructorhome.html">Login as instructor</a></p>

            </body>

        </html>


	);
};

export default AdminWelcome;
